import UseContext from './UseContext';
import UseEffect from './UseEffect';
import UseRef from './UseRef';
import UseState from './UseState';
import useReducer from './useReducer';

function App() {
  return (
    <div>
      {/* lazy initialization */}
      <UseState />
      {/* lifecycle & clean up */}
      <UseEffect />
      <UseRef />

      <UseContext />
      <useReducer />
    </div>
  );
}

export default App;
